import React, { Component } from 'react'

export class Footer extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return this.props.footerColor.map((data, index) => (
            <div onClick={this.props.onButtonClick.bind(this, index)} style={paginationButton} >
                <div style={indexButton}>{index}</div>
            </div>
        ))
    }
}
const paginationButton = {
    width: '30px',
    overflow: 'auto',
    display: 'inline-block'

}
const indexButton = {
    width: '20px',
    height: '20px',
    border: '1px solid black',
    background: 'white',
    display: 'inline-block',
    margin: '0 auto'
}


export default Footer
